import './App.css';

import React, {Component} from 'react';
import navbar from "./components/navbar/navbar";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
        <Router>
            <div>hello</div>
            <switch>
                <Route path="/SignUp" >
                    <navbar />
                </Route>
            </switch>
        </Router>
    );
  }
}

export default App;
